import React from 'react';
import { Card, Avatar } from 'antd';

const UserProfile = () => {
  return (
    <Card>
      <Card.Meta
        avatar={<Avatar>Diony</Avatar>}
        title="Dionysus"
      />
    </Card>
  );
};

export default UserProfile;
